import React, {useState} from 'react';

export default class Backend extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            username: '',
            email: null,
            gender: ''
        };
    }

    getData(){
        let url = 'https://api.sheety.co/a059a44709599c766a704967b9cc3d24/subscribers/subscribers';
        fetch(url)
            .then((response) => response.json())
            .then(json => {
                // Do something with the data
                console.log(json.subscribers);
            });
    }

    render(){
        return(
            this.getData
        )
    }
}
